// frontend/src/pages/Classes.js
import React, { useState, useEffect } from "react";
import axios from "axios";

const API_URL = "http://localhost:4000/classes"; 
const COURSES_API = "http://localhost:4000/courses"; 
const USERS_API = "http://localhost:4000/users"; 

const Classes = ({ userRole }) => {
  const [classes, setClasses] = useState([]);
  const [courses, setCourses] = useState([]);
  const [lecturers, setLecturers] = useState([]);
  const [formData, setFormData] = useState({
    className: "",
    courseId: "",
    lecturerId: "",
    semester: "",
  });

  // Fetch data
  const fetchClasses = async () => {
    try {
      const res = await axios.get(API_URL, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setClasses(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const fetchCourses = async () => {
    try {
      const res = await axios.get(COURSES_API, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setCourses(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const fetchLecturers = async () => {
    try {
      const res = await axios.get(USERS_API, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setLecturers(res.data.filter(u => u.role === "LECTURER"));
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchClasses();
    if (userRole === "PL" || userRole === "PRL") {
      fetchCourses();
      fetchLecturers();
    }
  }, []);

  // Handle input change
  const handleChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  // Add new class (only PL or PRL)
  const handleAddClass = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(API_URL, formData, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setClasses([...classes, res.data]);
      setFormData({ className: "", courseId: "", lecturerId: "", semester: "" });
      alert("Class added successfully!");
    } catch (err) {
      console.error(err);
      alert("Failed to add class");
    }
  };

  return (
    <div>
      <h2>Classes</h2>

      {/* Only PRL or PL can add classes */}
      {(userRole === "PL" || userRole === "PRL") && (
        <div style={{ marginBottom: "30px" }}>
          <h3>Add New Class</h3>
          <form onSubmit={handleAddClass}>
            <input
              name="className"
              placeholder="Class Name"
              value={formData.className}
              onChange={handleChange}
              required
            />
            <select name="courseId" value={formData.courseId} onChange={handleChange} required>
              <option value="">Select Course</option>
              {courses.map(c => (
                <option key={c.id} value={c.id}>{c.courseCode} - {c.courseName}</option>
              ))}
            </select>
            <select name="lecturerId" value={formData.lecturerId} onChange={handleChange} required>
              <option value="">Select Lecturer</option>
              {lecturers.map(l => (
                <option key={l.id} value={l.id}>{l.name}</option>
              ))}
            </select>
            <input
              name="semester"
              placeholder="Semester"
              value={formData.semester}
              onChange={handleChange}
            />
            <button type="submit">Add Class</button>
          </form>
        </div>
      )}

      {/* Classes Table (all users can see) */}
      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>ID</th>
            <th>Class Name</th>
            <th>Course</th>
            <th>Lecturer</th>
            <th>Semester</th>
          </tr>
        </thead>
        <tbody>
          {classes.map(cls => (
            <tr key={cls.id}>
              <td>{cls.id}</td>
              <td>{cls.className}</td>
              <td>{cls.course?.courseName || "-"}</td>
              <td>{cls.lecturer?.name || "-"}</td>
              <td>{cls.semester || "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Classes;
